	public Set<String> getDumplicateStr(String str){
		String newstr = StringUtil.urlDeCode(str, "gbk");
		Matcher m = StringUtil.createMatcher(newstr, "&.*?=");
		Map<String,Integer> map = new HashMap<String,Integer>();
		while(m.find()){
			if(map.get(m.group(0))==null){
				map.put(m.group(0),1);
			}else{
				map.put(m.group(0),map.get(m.group(0))+1);
			}
			
		}
		Set<String> set = new HashSet<String>();
		for(String s :map.keySet()){
			if(map.get(s)>1&&!s.contains("[")&&s.startsWith("&i"))
				//System.out.println(s+"-->"+map.get(s));
				set.add(s);
		}
		set.add("&_insuredFlag_hide=");
		return set;
	}
	public String replaceDuplicate(String str,Set<String> set){
		for(String s:set){
			str = str.replaceAll(s+".*?(?=&)", "");
		}
		return str;
	}
