	//系统保存提交报文参数转换成map
	public Map<String,String> getSaveMapParams(String str){
		Map<String,String> sysParams = new HashMap<String,String>();
		String newstr = StringUtil.urlDeCode(str, "gbk");
		String[] params = newstr.split("&");
		for(String param:params){
			String[] pa = param.split("=");
			if(pa.length==1){
				sysParams.put(pa[0], "");
			}else{
				sysParams.put(pa[0],pa[1]);
			}
		}
		//System.out.println("sysParams-->"+sysParams);
		return sysParams;
	}
